"   </div>",
"   <div class=\"block iuse drugH1Div\" id=\"F1977646\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Reported Use",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Respiratory stimulant used in acute respiratory failure such as chronic obstructive pulmonary disease (COPD)",
"    </p>",
"   </div>",
"   <div class=\"block idos drugH1Div\" id=\"F1977642\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosage Range",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Adults:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justified;\">",
"     Oral: 50-100 mg/day in 2 divided doses",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justified;\">",
"     I.V.: 1-3 mg/kg/day in divided doses",
"    </p>",
"   </div>",
