"    <span class=\"drugH1\">",
"     Product Availability",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Product available in various countries; not currently available in the U.S.",
"    </p>",
"   </div>",
"   <div class=\"block foc drugH1Div\" id=\"F1977645\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosage Forms",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justified;\">",
"     Injection, powder for reconstitution: 15 mg",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justified;\">",
"     Tablet, as dimesylate: 50 mg",
"    </p>",
