"    Clostridial myonecrosis computed tomography",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 592px; height: 245px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
