var title_f10_54_11118="Pravastatin and MACE rates in men versus women CARE trial";
var content_f10_54_11118=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F72888&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F72888&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 509px\">",
"   <div class=\"ttl\">",
"    Pravastatin is more effective in reducing major adverse cardiac events (MACE) in women than in men",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 489px; height: 275px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    In the CARE trial of patients with a recent history of myocardial infarction and average lipid levels, women had a greater reduction in coronary events (coronary death, nonfatal infarction, need for revascularization with angioplasty or surgery) with pravastatin, compared to placebo, than men (46 versus 20 percent reduction in men, P = 0.001 for both sexes).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Redrawn from: Lewis SJ, Sacks FM, Mitchell JS, et al. for the CARE Investigators, J Am Coll Cardiol 1998; 32:140.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
